import {Typography} from '@material-ui/core';


const Contact = () => {
    return(
        <>
        <Typography variant="caption">What's in your imagination</Typography>
        <Typography variant="h3">Lets talk about you</Typography>
        <Typography variant="h5">
            Have the next disruptive idea in mind or just want to chat, feel free to get i touch with me. Im that easy. Currently my time books quick so the sooner you write the better for both of us
        </Typography>
        <h1>Link when clicked opens up gmail.com</h1>
        </>
    )
}

export default Contact;
